/* ============================================== */
/* CSS for control sap.m/RadioButtonGroup.control */
/* BlueCrystal theme                              */
/* ============================================== */

.sapUiRbG > .sapUiRb:focus,
.sapUiRbGCol > .sapUiRb:focus{
