/* START "SearchField.less" */
/* ================================== */
/* CSS for control sap.m/SearchField  */
/* BlueCrystal theme                  */
/* ================================== */

.sapMSFDisabled {
	opacity: 0.5;
}

.sapMSubHeader-CTX .sapMSFF,
.sapMFooter-CTX .sapMSFF{
	border-color: transparent;
}

/* custom buttons */
.sapMSFB:focus {
	outline: none;
}

.sapMBarChild > .sapMSFF > .sapMSFB {
